import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { motion, AnimatePresence } from 'framer-motion';

const navVariants = {
  hidden: { y: -100, opacity: 0 },
  visible: { 
    y: 0, 
    opacity: 1,
    transition: {
      type: "spring",
      stiffness: 80,
      damping: 20,
      staggerChildren: 0.1
    }
  }
};

const linkVariants = {
  hidden: { y: -20, opacity: 0 },
  visible: { 
    y: 0, 
    opacity: 1,
    transition: { type: "spring", stiffness: 100 }
  }
};

export default function NavBar(){
  const [open, setOpen] = useState(false);

  return (
    <nav className="bg-white shadow-sm">
      <div className="container mx-auto px-4 py-3 flex items-center justify-between">
        <div className="flex items-center space-x-4">
          <motion.div initial={{ x: -120, opacity: 0 }} animate={{ x: 0, opacity: 1 }} transition={{ type: 'spring', stiffness: 80, damping: 16 }} className="text-2xl font-extrabold">
            <motion.span animate={{ y: [0, -4, 0] }} transition={{ repeat: Infinity, duration: 4, ease: 'easeInOut', delay: 0.8 }}>
              ஈழிசை
            </motion.span>
          </motion.div>

          <div className="hidden md:flex items-center space-x-4 text-gray-700">
            <Link to="/" className="hover:text-primary">முகப்புப் பக்கம்</Link>
            <Link to="/about" className="hover:text-primary">பற்றி</Link>
            <Link to="/courses" className="hover:text-primary">படிப்புகள்</Link>
            <Link to="/events" className="hover:text-primary">நிகழ்வுகள்</Link>
            <Link to="/contact" className="hover:text-primary">தொடர்பு</Link>
          </div>
        </div>

        <div className="flex items-center space-x-3">
          <Link to="/events" className="hidden md:inline-block px-4 py-2 border border-primary text-primary rounded">நிகழ்வுகள்</Link>
          <Link to="/contact" className="hidden md:inline-block bg-primary text-white px-4 py-2 rounded">இப்போது விண்ணப்பிக்கவும்</Link>

          {/* mobile menu button */}
          <button onClick={() => setOpen(!open)} className="md:hidden p-2 rounded bg-gray-100">
            <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 text-gray-700" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d={open ? "M6 18L18 6M6 6l12 12" : "M4 6h16M4 12h16M4 18h16"} />
            </svg>
          </button>
        </div>
      </div>

      {/* mobile menu */}
      {open && (
        <div className="md:hidden bg-white border-t">
          <div className="px-4 py-3 space-y-2">
            <Link to="/" onClick={() => setOpen(false)} className="block">முகப்புப் பக்கம்</Link>
            <Link to="/about" onClick={() => setOpen(false)} className="block">பற்றி</Link>
            <Link to="/courses" onClick={() => setOpen(false)} className="block">படிப்புகள்</Link>
            <Link to="/events" onClick={() => setOpen(false)} className="block">நிகழ்வுகள்</Link>
            <Link to="/contact" onClick={() => setOpen(false)} className="block">தொடர்பு</Link>
            <div className="pt-2">
              <Link to="/contact" onClick={() => setOpen(false)} className="block mb-2 bg-primary text-white text-center px-4 py-2 rounded">இப்போது விண்ணப்பிக்கவும்</Link>
              <Link to="/events" onClick={() => setOpen(false)} className="block text-center border border-primary text-primary px-4 py-2 rounded">நிகழ்வுகள்</Link>
            </div>
          </div>
        </div>
      )}
    </nav>
  );
}
